import Post from "../../components/Post/Post"

const Posts = (props) => { 

    const posts = props.data.map(p => {
        return <Post
            title={p.name}
            author={p.price}
            id={p.id}
            key={p.id}
        />
    });
    return posts;

}

export default Posts;
